var tipuesearch = {"pages": [{'title': '給酷接Q', 'text': '\n 倉儲: https://40823123.github.io/cad2020/ \n 小組倉儲: https://github.com/40823111/cad2020ag2 \n SSH: SSH步驟教學 \n', 'tags': '', 'url': '給酷接Q.html'}, {'title': '第一週', 'text': '1.設定網路中華DNS:[2001:b000:168::1] \n 連到我email裡面 \n >git confug --global user.email"40823123@gm.nfu.edu.tw" \n 連到我的名 \n >git config --global user.name"40823123" \n 增加網址裡的模組 \n >git submodule add"https://github.com/mdecourse/cmsimde.git cmsimde" \n 各組自行選擇製圖軟體來畫出圖形並記錄體積,本組用solidworks和inventer製作 \n 下方零件繪圖過程 圖檔連結 \n Inventer \n \n \n Solidworks \n \n', 'tags': '', 'url': '第一週.html'}, {'title': '第二週', 'text': 'pip install: 是一個 Python 安裝管理套件工具 \n tracert:windows系統,一種電腦網路工具 \n trace route: 可顯示 封包 在IP網路經過的 路由器 的 IP位址 \n name server lookup \n nslookup \n nfu dns:[2001:288:6004:1::2] \n \n', 'tags': '', 'url': '第二週.html'}, {'title': '第三週', 'text': '中秋節連假123123 \n', 'tags': '', 'url': '第三週.html'}, {'title': '第四週', 'text': 'solidworks-pdf1: \n \n 這周開始自評互評 \n 選出組長,每周meeting \n nx翻譯 \n 積木solidworks影片: \n \n 魯班鎖solidworks影片: \n \n', 'tags': '', 'url': '第四週.html'}, {'title': '第五週', 'text': 'wink \n \n', 'tags': '', 'url': '第五週.html'}, {'title': '第六週', 'text': 'API \n \n \n \n', 'tags': '', 'url': '第六週.html'}, {'title': '第七週', 'text': '工程師的特質 \n 1.富有創造性 \n 2.精確精巧很聰明的創造 \n \n 1.新增 \n set path_portablegit=%Disk%:\\Portablegit\\bin; \n set path_julia=%Disk%:\\julia-1.5.2\\bin; \n set path_tcc=%Disk%:\\tcc\\; \n \xa0 \n path=%Disk%:;%path_python%;%path_portablegit%;%path_julia%;%path_tcc%;%path%; \n 至start.bat \n 2.修改cpp.properties裡面的東西 \n ccopts=-pedantic -Os \n #cc=g++ $(ccopts) -c $(FileNameExt) -o $(FileName).o \n #ccc=gcc $(ccopts) -c $(FileNameExt) -o $(FileName).o \n cc=y:/tcc/tcc.exe -run \n ccc=y:/tcc/tcc.exe -run \n \xa0 \n make.command=make \n command.compile.*.c=$(ccc) -std=c99 \n command.build.*.c=$(make.command) \n command.build.*.h=$(make.command) \n command.clean.*.c=$(make.command) clean \n command.clean.*.h=$(make.command) clean \n command.go.*.c=$(cc) $(FileNameExt) \n #command.go.*.c=./$(FileName) \n # To make the Go command both compile (if needed) and execute, use this setting: \n 3.儲存完後儲存副檔名 \n \n \n \n', 'tags': '', 'url': '第七週.html'}, {'title': '第九週', 'text': '用參數來畫圖代替手繪\n pyslvs連桿機構軟體 \n 下載coppeliasim\xa0 \xa0\xa0 用C / C ++，Python，Java，Lua，Matlab或Octave編寫 \n \n \n 設法讓機器看得見, 能夠藉以判讀環境內容, 從容運作 \n 讓原本繁雜的流程自動化, 提升操作者的生活品質 \n \n \n \n', 'tags': '', 'url': '第九週.html'}, {'title': '第十週', 'text': '小組分組討論 共同創造一個機構 使用CoppeliaSim 模擬出來\xa0 並且每個禮拜使用Meeting進行討論 \n', 'tags': '', 'url': '第十週.html'}, {'title': '第十一週', 'text': '1. 當分組開始啟動 電腦輔助設計專案 後, 可將分組網站的動態網站在 cadlab Group Leader 的電腦上,組\xa0 \xa0 \xa0員可以在不同時間的情況下分別推送資料 \n 2.繼續研究CoppeliaSim 組別各自完成自己的任務 \n \n', 'tags': '', 'url': '第十一週.html'}, {'title': '第十二週', 'text': '第二次經過討論進行修改 \n \n \n', 'tags': '', 'url': '第十二週.html'}, {'title': '第十三週', 'text': '用Pyslvs 模擬一個三連趕機構 運球系統的機構 \n \n', 'tags': '', 'url': '第十三週.html'}, {'title': '第十四週', 'text': '\n 原先是設計成直的但球因為重力的緣故會往下掉所以改成斜的 \n \n \n', 'tags': '', 'url': '第十四週.html'}, {'title': '第十五週', 'text': '設計改善 \n 軌道需加長不然球會掉落,抑或是將球尺寸增大(增大後軌道也需調整) \n \n 平台改善 : 凸輪上下的位移量 = 平台厚度 = 軌道高度 ( 避免球卡住 ) + 增加斜坡 ( 確保球在平台上 ) \n \n 改善圖 \n \n 因為原先軌道(藍色區塊)球敲入後會有停住的狀況於是我們將槌子敲擊方向與軌道外側面平行 \n 這樣球就可以順著軌道進入下一個環節 \n \n 球滾到該區域時(箭頭處)會卡死須將該平面修改成斜面以利球體滾動 \n \n 改善後之斜面體 \n \n', 'tags': '', 'url': '第十五週.html'}, {'title': '小組會議meeting', 'text': '第一次會議(第十週) \n 先進行分組的動作共分三組,分別是機構組,製圖組,程式組 \n \n 第二次會議(第十一週) \n 讓他可以動作 \n \n 第三次會議(第十二週) \n \n 第四次會議(第十三週) \n \n \n 第五次會議(第十四週) \n   \n \n 最後一次會議(第十五週) \n 將組別的網站用好 \n', 'tags': '', 'url': '小組會議meeting.html'}, {'title': '小組中負責的內容', 'text': 'HW1 PDF \n \n  PDF2魯班鎖   CoppeliaSim 我被分到機構創作組但為了讓設計的可實際達成率高我也有碰程式組只有一部分 \n', 'tags': '', 'url': '小組中負責的內容.html'}]};